inline int rev(int x){
    int ret=0;
    while(x){
        ret*=10;
        ret+=x%10;
        x/=10;
    }
    while(ret<1000000)
        ret*=10;
    return ret;
}

inline int pos(int x){
    iter=lower_bound(num.begin(),num.end(),x);
    if(*iter!=x)return -1;
    return iter-num.begin();
}

inline void del2(int x){
    iter2=lower_bound(num2.begin(),num2.end(),x);
    if(*iter2!=x)return;
    num2.erase(iter2);
}

inline int lowbit(int x){
    return x&(-x);
}

inline void modify(int pos,int num) {
    while (pos<=n) {
        WTF[pos]+=num;
        pos+=lowbit(pos);
    }
}

inline int query(int end) {
    int sum=0;
    while (end>0) {
        sum+=WTF[end];
        end-=lowbit(end);
    }
    return sum;
}

